import React,{useState} from 'react';

const Landing = () => {
    const [active, setActive] = useState("white")
    const tabList = [ 
        {
            name: 'Home',
            label:'Home',
        },
        { 
            name: 'Collections',
            label:'Collections',
        },
        { 
            name: 'About us',
            label:'About us',
        },
        { 
            name: 'Refunds & returns',
            label:'Refunds & returns',
        },
        { 
            name: 'Everything and Afrithings',
            label:'Everything and Afrithings',
        },
    ]
    let SelectItem = 
    <div
        style={{
            position:"fixed",
            top:"10vh",
            left:"10vw",
            width:"40vw"
        }}
    >
    {
            tabList.map((tab, i) => (
                <div
                    style={{
                       position:"relative",
                       left:"10vw"
                    }}
                >
                <button 
                key={i}
                style={{
                    position:"relative",
                    textTransform:"none",
                    height:"3vh",
                    border:"none",
                    borderRadius:"2px",
                    display:"flex",
                    color:active === i ? "white" :"black",
                    background:"skyblue",
                    marginLeft:"2vw",
                    float:"left"
                }}>
                    {tab.label}
                </button>
                </div>
            ))
    }
    </div>
    return(
        <div>
            {SelectItem}
        </div>
    )
}
export default Landing;
